@SuppressWarnings("unchecked")
public List<Map.Entry<byte[], List<StreamEntryBinary>>> build(Object data) {
  if (data == null) return null;
  final List list = (List) data;
  if (list.isEmpty()) return Collections.emptyList();

  if (list.get(0) instanceof KeyValue) {
    return ((List<KeyValue>) list).stream()
        .map(kv -> new KeyValue<>(
            BINARY.build(kv.getKey()),
            STREAM_ENTRY_BINARY_LIST.build(kv.getValue())
        ))
        .collect(Collectors.toList());
  } else {
    final List<Map.Entry<byte[], List<StreamEntryBinary>>> result = new ArrayList<>(list.size());
    for (Object anObj : list) {
      final List<Object> streamObj = (List<Object>) anObj;
      final byte[] streamKey = BINARY.build(streamObj.get(0));
      final List<StreamEntryBinary> streamEntries = STREAM_ENTRY_BINARY_LIST.build(streamObj.get(1));
      result.add(KeyValue.of(streamKey, streamEntries));
    }
    return result;
  }
}

