private static boolean canBeSubclassed(DetailAST classDef) {
    final DetailAST modifiers = classDef.findFirstToken(TokenTypes.MODIFIERS);
    return classDef.getType() != TokenTypes.ENUM_DEF
            && modifiers.findFirstToken(TokenTypes.FINAL) == null
            && hasDefaultOrExplicitNonPrivateCtor(classDef);
}

private static Set<DetailAST> getAllTokensOfType(DetailAST ast, int tokenType) {
    DetailAST vertex = ast;
    final Set<DetailAST> result = new HashSet<>();
    final Deque<DetailAST> stack = new ArrayDeque<>();
    while (vertex != null || !stack.isEmpty()) {
        if (!stack.isEmpty()) {
            vertex = stack.pop();
        }
        while (vertex != null) {
            if (vertex.getType() == tokenType) {
                result.add(vertex);
            }
            if (vertex.getNextSibling() != null) {
                stack.push(vertex.getNextSibling());
            }
            vertex = vertex.getFirstChild();
        }
    }
    return result;
}

