public static String getFileExtension(String fileNameWithExtension) {
    final String fileName = Paths.get(fileNameWithExtension).toString();
    final int dotIndex = fileName.lastIndexOf('.');
    final String extension;
    if (dotIndex == -1) {
        extension = "";
    }
    else {
        extension = fileName.substring(dotIndex + 1);
    }
    return extension;
}

private static Set<DetailAST> getAllTokensWhichAreEqualToCurrent(DetailAST ast, DetailAST token,
                                                                 int endLineNumber) {
    DetailAST vertex = ast;
    final Set<DetailAST> result = new HashSet<>();
    final Deque<DetailAST> stack = new ArrayDeque<>();
    while (vertex != null || !stack.isEmpty()) {
        if (!stack.isEmpty()) {
            vertex = stack.pop();
        }
        while (vertex != null) {
            if (isAstSimilar(token, vertex)
                    && vertex.getLineNo() <= endLineNumber) {
                result.add(vertex);
            }
            if (vertex.getNextSibling() != null) {
                stack.push(vertex.getNextSibling());
            }
            vertex = vertex.getFirstChild();
        }
    }
    return result;
}

private static DetailAST getNearestClassOrEnumDefinition(DetailAST ast) {
    DetailAST searchAST = ast;
    while (searchAST.getType() != TokenTypes.CLASS_DEF
            && searchAST.getType() != TokenTypes.ENUM_DEF) {
        searchAST = searchAST.getParent();
    }
    return searchAST;
}

private boolean isForwardReference(DetailAST fieldDef) {
    final DetailAST exprStartIdent = fieldDef.findFirstToken(TokenTypes.IDENT);
    final Set<DetailAST> exprIdents = getAllTokensOfType(exprStartIdent, TokenTypes.IDENT);
    boolean forwardReference = false;
    for (DetailAST ident : exprIdents) {
        if (classFieldNames.contains(ident.getText())) {
            forwardReference = true;
            break;
        }
    }
    return forwardReference;
}

