}

@Override
public DetailAstImpl visitLambdaExp(JavaLanguageParser.LambdaExpContext ctx) {
    final DetailAstImpl lambda = create(ctx.LAMBDA());
    lambda.addChild(visit(ctx.lambdaParameters()));

    final JavaLanguageParser.BlockContext blockContext = ctx.block();
    final DetailAstImpl rightHandLambdaChild;
    if (blockContext != null) {
        rightHandLambdaChild = visit(blockContext);
    }
    else {
        rightHandLambdaChild = buildExpressionNode(ctx.expr());
    }
    lambda.addChild(rightHandLambdaChild);
    return lambda;
}

@Override
public DetailAstImpl visitInterfaceMethodDeclaration(
        JavaLanguageParser.InterfaceMethodDeclarationContext ctx) {
    final DetailAstImpl methodDef = createImaginary(TokenTypes.METHOD_DEF);
    methodDef.addChild(createModifiers(ctx.mods));

    final List<ParseTree> children = ctx.children
            .stream()
            .filter(child -> !(child instanceof JavaLanguageParser.ArrayDeclaratorContext))
            .collect(Collectors.toUnmodifiableList());
    processChildren(methodDef, children);

    final DetailAstImpl typeAst = (DetailAstImpl) methodDef.findFirstToken(TokenTypes.TYPE);
    ctx.cStyleArrDec.forEach(child -> typeAst.addChild(visit(child)));

    return methodDef;
}

@Override
public DetailAstImpl visitForFor(JavaLanguageParser.ForForContext ctx) {
    final DetailAstImpl dummyRoot = new DetailAstImpl();
    dummyRoot.addChild(create(ctx.LPAREN()));

    dummyRoot.addChild(ctx.forInit() == null
        ? createImaginary(TokenTypes.FOR_INIT)
        : visit(ctx.forInit()));

    dummyRoot.addChild(create(ctx.SEMI(0)));

    final DetailAstImpl forCondParent = createImaginary(TokenTypes.FOR_CONDITION);
    forCondParent.addChild(visit(ctx.forCond));
    dummyRoot.addChild(forCondParent);
    dummyRoot.addChild(create(ctx.SEMI(1)));

    final DetailAstImpl forItParent = createImaginary(TokenTypes.FOR_ITERATOR);
    forItParent.addChild(visit(ctx.forUpdate));
    dummyRoot.addChild(forItParent);

    dummyRoot.addChild(create(ctx.RPAREN()));

    return dummyRoot.getFirstChild();
}

private static Map.Entry<Integer, Integer> countLinesColumns(
    String text, int initialLinesCnt, int initialColumnsCnt) {
    int lines = initialLinesCnt;
    int columns = initialColumnsCnt;
    boolean foundCr = false;
    for (char c : text.toCharArray()) {
        if (c == '\n') {
            foundCr = false;
            lines++;
            columns = 0;
        }
        else {
            if (foundCr) {
                foundCr = false;
                lines++;
                columns = 0;
            }
            if (c == '\r') {
                foundCr = true;
            }
            columns++;
        }
    }
    if (foundCr) {
        lines++;
        columns = 0;
    }
    return new AbstractMap.SimpleEntry<>(lines, columns);
}

public static Properties getResolvedProperties(Properties properties)
        throws CheckstyleException {
    final Set<String> unresolvedPropertyNames =
        new HashSet<>(properties.stringPropertyNames());
    final Iterator<String> unresolvedPropertyIterator = unresolvedPropertyNames.iterator();
    final Map<Object, Object> comparisonProperties = new Properties();

    while (unresolvedPropertyIterator.hasNext()) {
        final String propertyName = unresolvedPropertyIterator.next();
        String propertyValue = properties.getProperty(propertyName);
        final Matcher matcher = PROPERTY_VARIABLE_PATTERN.matcher(propertyValue);

        while (matcher.find()) {
            final String propertyVariableExpression = matcher.group();
            final String unresolvedPropertyName =
                getPropertyNameFromExpression(propertyVariableExpression);

            final String resolvedPropertyValue =
                properties.getProperty(unresolvedPropertyName);

            if (resolvedPropertyValue != null) {
                propertyValue = propertyValue.replace(propertyVariableExpression,
                    resolvedPropertyValue);
                properties.setProperty(propertyName, propertyValue);
            }
        }

        if (allChainedPropertiesAreResolved(propertyValue)) {
            unresolvedPropertyIterator.remove();
        }

        if (!unresolvedPropertyIterator.hasNext()) {
            if (comparisonProperties.equals(properties)) {
                throw new CheckstyleException(UNDEFINED_PROPERTY_MESSAGE
                    + unresolvedPropertyNames);
            }
            comparisonProperties.putAll(properties);
            unresolvedPropertyIterator = unresolvedPropertyNames.iterator();
        }
    }
    return properties;
}

