    for (DetailAST branch = branchLeadingToReassignedVar;
         branch != null;
         branch = traverseUntilNeededBranchType(branch,
             branchLeadingToReassignedVar, TokenTypes.EXPR)) {

        final DetailAST assignToken = getMatchedAssignToken(branch);
        if (assignToken != null) {
            reassignedVariableIdents.add(getNeededAssignIdent(assignToken));
        }
    }

    return reassignedVariableIdents;
}

