    for (DetailAST iteratedBranch = shiftToNextTraversedBranch(startingBranch, bound);
         iteratedBranch != null;
         iteratedBranch = shiftToNextTraversedBranch(iteratedBranch, bound)) {

        if (iteratedBranch.getType() == neededTokenType) {
            match = iteratedBranch;
            break;
        }
    }

    return match;
}

