        fileExt = "html";
    } else if (format.startsWith("flat") || format.startsWith("traces") 
                || format.equals("collapsed")) {
        fileExt = "txt";
    } else if (format.equals("flamegraph") || format.equals("tree")) {
        fileExt = "html";
