public void writeData(ByteBuf byteBuf) {
    byte[] bytes = ByteUtil.getBytes(byteBuf);
    if (bytes.length == 0) {
        return;
    }
    byte[] decompressedData = decompressGzip(bytes);
    if (decompressedData == null) {
