private ApiResponse processExecRequest(ApiRequest apiRequest, Session session) {
    boolean oneTimeAccess = session.get(ONETIME_SESSION_KEY) != null;

    try {
        String commandLine = apiRequest.getCommand();
        Map<String, Object> body = new TreeMap<>();
        body.put("command", commandLine);

        ApiResponse response = new ApiResponse()
                .setSessionId(session.getSessionId())
                .setBody(body);

        if (!session.tryLock()) {
            return response.setState(ApiState.REFUSED)
                           .setMessage("Another command is executing.");
        }

        int lock = session.getLock();
        PackingResultDistributor packingResultDistributor = null;
        Job job = null;
        try {
            Job foregroundJob = session.getForegroundJob();
            if (foregroundJob != null) {
                return response.setState(ApiState.REFUSED)
                               .setMessage("Another job is running.");
            }

            packingResultDistributor = new PackingResultDistributorImpl(session);
            job = createJob(commandLine, session, packingResultDistributor);
            session.setForegroundJob(job);
            updateSessionInputStatus(session, InputStatus.ALLOW_INTERRUPT);

            job.run();
        } catch (Throwable e) {
            logger.error("Exec command failed:" + e.getMessage() + ", command:" + commandLine, e);
            return response.setState(ApiState.FAILED)
                           .setMessage("Exec command failed:" + e.getMessage());
        } finally {
            if (session.getLock() == lock) {
                session.unLock();
            }
        }

        Integer timeout = apiRequest.getExecTimeout();
        timeout = (timeout == null || timeout <= 0) ? DEFAULT_EXEC_TIMEOUT : timeout;
        boolean timeExpired = !waitForJob(job, timeout);

        if (timeExpired) {
            job.interrupt();
            response.setState(ApiState.INTERRUPTED)
                   .setMessage("The job is exceeded time limit, force interrupt");
        } else {
            response.setState(ApiState.SUCCEEDED);
        }

        body.put("jobId", job.id());
        body.put("jobStatus", job.status());
        body.put("timeExpired", timeExpired);
        if (timeExpired) {
            body.put("timeout", timeout);
        }
        body.put("results", packingResultDistributor.getResults());

        return response.setSessionId(session.getSessionId())
                      .setBody(body);
    } finally {
        if (oneTimeAccess) {
            sessionManager.removeSession(session.getSessionId());
        }
    }
}

private void recursive(int deep, boolean isLast, String prefix, TraceNode node, Callback callback) {
    callback.callback(deep, isLast, prefix, node);
    if (!isLeaf(node)) {
        List<TraceNode> children = node.getChildren();
        if (children == null) return;

        int size = children.size();
        for (int index = 0; index < size; index++) {
            boolean isLastFlag = index == size - 1;
            String currentPrefix = isLast ? prefix + STEP_EMPTY_BOARD : prefix + STEP_HAS_BOARD;
            recursive(
                deep + 1,
                isLastFlag,
                currentPrefix,
                children.get(index),
                callback
            );
        }
    }
}

private static void renderSubtree(TreeElement parent, ClassLoaderVO parentClassLoader) {
    if (parentClassLoader.getChildren() == null) return;

    for (ClassLoaderVO childClassLoader : parentClassLoader.getChildren()) {
        TreeElement child = new TreeElement(childClassLoader.getName());
        parent.addChild(child);
        renderSubtree(child, childClassLoader);
    }
}

