public void loggers(CommandProcess process) {
    Map<ClassLoader, LoggerTypes> classLoaderLoggerMap = new LinkedHashMap<>();

    for (Class<?> clazz : process.session().getInstrumentation().getAllLoadedClasses()) {
        String className = clazz.getName();
        ClassLoader classLoader = clazz.getClassLoader();

        if (this.hashCode != null && !this.hashCode.equals(StringUtils.classLoaderHash(clazz))) {
            continue;
        }

        if (classLoader != null) {
            LoggerTypes loggerTypes = classLoaderLoggerMap.get(classLoader);
            if (loggerTypes == null) {
                loggerTypes = new LoggerTypes();
                classLoaderLoggerMap.put(classLoader, loggerTypes);
            }
            updateLoggerType(loggerTypes, classLoader, className);
        }
    }

    for (Entry<ClassLoader, LoggerTypes> entry : classLoaderLoggerMap.entrySet()) {
        ClassLoader classLoader = entry.getKey();
        LoggerTypes loggerTypes = entry.getValue();

        if (loggerTypes.contains(LoggerType.LOG4J)) {
            Map<String, Map<String, Object>> loggerInfoMap = loggerInfo(classLoader, Log4jHelper.class);
            process.appendResult(new LoggerModel(loggerInfoMap));
        }
        if (loggerTypes.contains(LoggerType.LOGBACK)) {
            Map<String, Map<String, Object>> loggerInfoMap = loggerInfo(classLoader, LogbackHelper.class);
            process.appendResult(new LoggerModel(loggerInfoMap));
        }
        if (loggerTypes.contains(LoggerType.LOG4J2)) {
            Map<String, Map<String, Object>> loggerInfoMap = loggerInfo(classLoader, Log4j2Helper.class);
            process.appendResult(new LoggerModel(loggerInfoMap));
        }
    }

    process.end();
}

private void agentRegister(ChannelHandlerContext ctx, HandshakeComplete handshake, String requestUri) throws URISyntaxException {
    QueryStringDecoder queryDecoder = new QueryStringDecoder(requestUri);
    Map<String, List<String>> parameters = queryDecoder.parameters();

    String appName = null;
    List<String> appNameList = parameters.get(URIConstans.APP_NAME);
    if (appNameList != null && !appNameList.isEmpty()) {
        appName = appNameList.get(0);
    }

    String id = null;
    if (appName != null) {
        id = appName + "_" + RandomStringUtils.random(20, true, true).toUpperCase();
    } else {
        id = RandomStringUtils.random(20, true, true).toUpperCase();
    }

    List<String> idList = parameters.get(URIConstans.ID);
    if (idList != null && !idList.isEmpty()) {
        id = idList.get(0);
    }

    String arthasVersion = null;
    List<String> arthasVersionList = parameters.get(URIConstans.ARTHAS_VERSION);
    if (arthasVersionList != null && !arthasVersionList.isEmpty()) {
        arthasVersion = arthasVersionList.get(0);
    }

    final String finalId = id;

    URI responseUri = UriComponentsBuilder.newInstance()
            .scheme(URIConstans.RESPONSE)
            .path("/")
            .queryParam(URIConstans.METHOD, MethodConstants.AGENT_REGISTER)
            .queryParam(URIConstans.ID, id)
            .build()
            .encode()
            .toUri();

    AgentInfo info = new AgentInfo();
    HttpHeaders headers = handshake.requestHeaders();
    String host = HttpUtils.findClientIP(headers);

    if (host == null) {
        SocketAddress remoteAddress = ctx.channel().remoteAddress();
        if (remoteAddress instanceof InetSocketAddress) {
            InetSocketAddress inetSocketAddress = (InetSocketAddress) remoteAddress;
            info.setHost(inetSocketAddress.getHostString());
            info.setPort(inetSocketAddress.getPort());
        }
    } else {
        info.setHost(host);
        Integer port = HttpUtils.findClientPort(headers);
        if (port != null) {
            info.setPort(port);
        }
    }

    info.setChannelHandlerContext(ctx);
    if (arthasVersion != null) {
        info.setArthasVersion(arthasVersion);
    }

    tunnelServer.addAgent(id, info);
    ctx.channel().closeFuture().addListener(new GenericFutureListener<Future<? super Void>>() {
        @Override
        public void operationComplete(Future<? super Void> future) throws Exception {
            tunnelServer.removeAgent(finalId);
        }
    });

    ctx.channel().writeAndFlush(new TextWebSocketFrame(responseUri.toString()));
}

public ChannelFuture connect(boolean reconnect) throws SSLException, URISyntaxException, InterruptedException {
    QueryStringEncoder queryEncoder = new QueryStringEncoder(this.tunnelServerUrl);
    queryEncoder.addParam(URIConstans.METHOD, MethodConstants.AGENT_REGISTER);
    queryEncoder.addParam(URIConstans.ARTHAS_VERSION, this.version);
    if (appName != null) {
        queryEncoder.addParam(URIConstans.APP_NAME, appName);
    }
    if (id != null) {
        queryEncoder.addParam(URIConstans.ID, id);
    }

    final URI agentRegisterURI = queryEncoder.toUri();
    logger.info("Try to register arthas agent, uri: {}", agentRegisterURI);

    String scheme = agentRegisterURI.getScheme() == null ? "ws" : agentRegisterURI.getScheme();
    final String host = agentRegisterURI.getHost() == null ? "127.0.0.1" : agentRegisterURI.getHost();
    final int port;
    if (agentRegisterURI.getPort() == -1) {
        port = "ws".equalsIgnoreCase(scheme) ? 80 : 443;
    } else {
        port = agentRegisterURI.getPort();
    }

    if (!"ws".equalsIgnoreCase(scheme) && !"wss".equalsIgnoreCase(scheme)) {
        throw new IllegalArgumentException("Only WS(S) is supported. tunnelServerUrl: " + tunnelServerUrl);
    }

    final SslContext sslCtx = "wss".equalsIgnoreCase(scheme)
            ? SslContextBuilder.forClient().trustManager(InsecureTrustManagerFactory.INSTANCE).build()
            : null;

    WebSocketClientProtocolConfig clientProtocolConfig = WebSocketClientProtocolConfig.newBuilder()
            .webSocketUri(agentRegisterURI)
            .maxFramePayloadLength(ArthasConstants.MAX_HTTP_CONTENT_LENGTH)
            .build();

    WebSocketClientProtocolHandler websocketClientHandler = new WebSocketClientProtocolHandler(clientProtocolConfig);
    TunnelClientSocketClientHandler handler = new TunnelClientSocketClientHandler(TunnelClient.this);

    Bootstrap bs = new Bootstrap();
    bs.group(eventLoopGroup)
            .option(ChannelOption.CONNECT_TIMEOUT_MILLIS, 5000)
            .option(ChannelOption.TCP_NODELAY, true)
            .channel(NioSocketChannel.class)
            .remoteAddress(host, port)
            .handler(new ChannelInitializer<SocketChannel>() {
                @Override
                protected void initChannel(SocketChannel ch) {
                    ChannelPipeline p = ch.pipeline();
                    if (sslCtx != null) {
                        p.addLast(sslCtx.newHandler(ch.alloc(), host, port));
                    }
                    p.addLast(
                        new HttpClientCodec(),
                        new HttpObjectAggregator(ArthasConstants.MAX_HTTP_CONTENT_LENGTH),
                        websocketClientHandler,
                        new IdleStateHandler(0, 0, ArthasConstants.WEBSOCKET_IDLE_SECONDS),
                        handler
                    );
                }
            });

    ChannelFuture connectFuture = bs.connect();
    if (reconnect) {
        connectFuture.addListener(new ChannelFutureListener() {
            @Override
            public void operationComplete(ChannelFuture future) throws Exception {
                if (future.cause() != null) {
                    logger.error("connect to tunnel server error, uri: {}", tunnelServerUrl, future.cause());
                }
            }
        });
    }
    connectFuture.sync();

    return handler.registerFuture();
}

