@Override
public int read() throws IOException {
    synchronized (__queue) {
        while (true) {
            if (__ioException != null) {
                IOException e = __ioException;
                __ioException = null;
                throw e;
            }

            if (__bytesAvailable == 0) {
                if (__hasReachedEOF) {
                    return EOF;
                }

                if (__threaded) {
                    __queue.notify();
                    try {
                        __readIsWaiting = true;
                        __queue.wait();
                        __readIsWaiting = false;
                    } catch (InterruptedException e) {
                        throw new InterruptedIOException("Fatal thread interruption during read.");
                    }
                } else {
                    __readIsWaiting = true;
                    int ch;
                    boolean mayBlock = true;

                    do {
                        try {
                            if ((ch = __read(mayBlock)) < 0) {
                                if (ch != WOULD_BLOCK) {
                                    return ch;
                                }
                            }
                        } catch (InterruptedIOException e) {
                            synchronized (__queue) {
                                __ioException = e;
                                __queue.notifyAll();
                                try {
                                    __queue.wait(100);
                                } catch (InterruptedException interrupted) {
                                }
                            }
                            return EOF;
                        }

                        try {
                            if (ch != WOULD_BLOCK) {
                                __processChar(ch);
                            }
                        } catch (InterruptedException e) {
                            if (__isClosed) {
                                return EOF;
                            }
                        }
                        mayBlock = false;
                    } while (super.available() > 0 && __bytesAvailable < __queue.length - 1);

                    __readIsWaiting = false;
                }
                continue;
            } else {
                int ch = __queue[__queueHead];
                if (++__queueHead >= __queue.length) {
                    __queueHead = 0;
                }

                --__bytesAvailable;
                if (__bytesAvailable == 0 && __threaded) {
                    __queue.notify();
                }

                return ch;
            }
        }
    }
}

@Override
public void process(CommandProcess process) {
    initTransformer();
    RetransformModel retransformModel = new RetransformModel();
    Instrumentation inst = process.session().getInstrumentation();

    if (this.list) {
        retransformModel.setRetransformEntries(allRetransformEntries());
        process.appendResult(retransformModel);
        process.end();
        return;
    }

    if (this.deleteAll) {
        deleteAllRetransformEntry();
        process.appendResult(retransformModel);
        process.end();
        return;
    }

    if (this.delete > 0) {
        deleteRetransformEntry(this.delete);
        process.end();
        return;
    }

    if (this.classPattern != null) {
        Set<Class<?>> searchClass = SearchUtils.searchClass(inst, classPattern, false, this.hashCode);
        if (searchClass.isEmpty()) {
            process.end(-1, "These classes are not found in the JVM and may not be loaded: " + classPattern);
            return;
        }

        if (searchClass.size() > limit) {
            process.end(-1, "match classes size: " + searchClass.size() + ", more than limit: " + limit
                    + ", use more precise class pattern");
            return;
        }

        try {
            inst.retransformClasses(searchClass.toArray(new Class[0]));
            searchClass.forEach(clazz -> retransformModel.addRetransformClass(clazz.getName()));
            process.appendResult(retransformModel);
            process.end();
        } catch (Throwable e) {
            String message = "retransform error! " + e;
            logger.error(message, e);
            process.end(-1, message);
        }
        return;
    }

    Map<String, byte[]> bytesMap = new HashMap<>();
    for (String path : paths) {
        File file = new File(path);
        if (!validateFile(process, file)) return;

        try (RandomAccessFile f = new RandomAccessFile(path, "r")) {
            byte[] bytes = new byte[(int) f.length()];
            f.readFully(bytes);
            bytesMap.put(readClassName(bytes), bytes);
        } catch (Exception e) {
            logger.warn("load class file failed: {}", path, e);
            process.end(-1, "load class file failed: " + path + ", error: " + e);
            return;
        }
    }

    if (bytesMap.size() != paths.size()) {
        process.end(-1, "paths contain duplicate class names");
        return;
    }

    List<RetransformEntry> retransformEntryList = new ArrayList<>();
    List<Class<?>> classList = new ArrayList<>();

    for (Class<?> clazz : inst.getAllLoadedClasses()) {
        if (bytesMap.containsKey(clazz.getName())) {
            handleClassLoaderMatching(process, retransformModel, clazz);

            ClassLoader classLoader = clazz.getClassLoader();
            if (classLoader != null && hashCode != null
                    && !Integer.toHexString(classLoader.hashCode()).equals(hashCode)) {
                continue;
            }

            retransformEntryList.add(new RetransformEntry(
                clazz.getName(),
                bytesMap.get(clazz.getName()),
                hashCode,
                classLoaderClass
            ));
            classList.add(clazz);
            retransformModel.addRetransformClass(clazz.getName());
            logger.info("Retransform class: {}, ClassLoader: {}", clazz.getName(), clazz.getClassLoader());
        }
    }

    try {
        if (retransformEntryList.isEmpty()) {
            process.end(-1, "Classes not loaded: " + bytesMap.keySet());
            return;
        }
        addRetransformEntry(retransformEntryList);
        inst.retransformClasses(classList.toArray(new Class[0]));
        process.appendResult(retransformModel);
        process.end();
    } catch (Throwable e) {
        String message = "retransform error! " + e;
        logger.error(message, e);
        process.end(-1, message);
    }
}

private boolean validateFile(CommandProcess process, File file) {
    if (!file.exists()) {
        process.end(-1, "file does not exist: " + file.getPath());
        return false;
    }
    if (!file.isFile()) {
        process.end(-1, "not a file: " + file.getPath());
        return false;
    }
    if (file.length() >= MAX_FILE_SIZE) {
        process.end(-1, "file too large: " + file.getPath());
        return false;
    }
    return true;
}

V get(Object key, int hash) {
    if (count != 0) { // read-volatile
        HashEntry<K, V> e = getFirst(hash);
        while (e != null) {
            if (e.hash == hash && keyEq(key, e.key())) {
                Object opaque = e.valueRef;
                if (opaque != null) {
                    return e.dereferenceValue(opaque);
                }
                return readValueUnderLock(e);
            }
            e = e.next;
        }
    }
    return null;
}

