@Override
public Map<String, String> findNativeAgent(String address) {
    if (address == null || address.isEmpty()) {
        return null;
    }

    try {
        ZooKeeper zooKeeper = new ZooKeeper(address, SESSION_TIMEOUT, event -> {
            if (event.getState() == Watcher.Event.KeeperState.SyncConnected) {
                connectedSemaphore.countDown();
            }
        });
        connectedSemaphore.await();

        List<String> children = zooKeeper.getChildren(NativeAgentConstants.NATIVE_AGENT_KEY, false);
        Map<String, String> result = new ConcurrentHashMap<>(children.size());

        for (String child : children) {
            String childPath = NativeAgentConstants.NATIVE_AGENT_KEY + "/" + child;
            byte[] data = zooKeeper.getData(childPath, false, new Stat());
            result.put(child, new String(data));
        }

        zooKeeper.close();
        return result;
    } catch (Exception e) {
        throw new RuntimeException(e);
    }
}

private FullHttpResponse forwardRequest(FullHttpRequest request, String address) {
    OkHttpClient client = new OkHttpClient.Builder()
        .connectTimeout(10, TimeUnit.SECONDS)
        .readTimeout(30, TimeUnit.SECONDS)
        .writeTimeout(30, TimeUnit.SECONDS)
        .build();

    RequestBody body = RequestBody.create(
        request.content().toString(CharsetUtil.UTF_8),
        MediaType.parse("application/json; charset=utf-8")
    );

    Request okRequest = new Request.Builder()
        .url("http://" + address + "/api/native-agent")
        .post(body)
        .build();

    try {
        Response response = client.newCall(okRequest).execute();

        if (response.isSuccessful()) {
            DefaultFullHttpResponse httpResponse = new DefaultFullHttpResponse(
                request.getProtocolVersion(),
                HttpResponseStatus.OK,
                Unpooled.copiedBuffer(response.body().string(), StandardCharsets.UTF_8)
            );

            httpResponse.headers()
                .set(HttpHeaderNames.ACCESS_CONTROL_ALLOW_ORIGIN, "*")
                .set(HttpHeaderNames.ACCESS_CONTROL_ALLOW_METHODS, "GET, POST, PUT, DELETE, OPTIONS")
                .set(HttpHeaderNames.ACCESS_CONTROL_ALLOW_HEADERS, "X-Requested-With, Content-Type, Authorization")
                .set(HttpHeaderNames.CONTENT_TYPE, "application/json")
                .set(HttpHeaderNames.CONTENT_LENGTH, httpResponse.content().readableBytes());

            return httpResponse;
        } else {
            return new DefaultFullHttpResponse(
                HttpVersion.HTTP_1_1,
                HttpResponseStatus.valueOf(response.code()),
                Unpooled.copiedBuffer("Error: " + response.message(), CharsetUtil.UTF_8)
            );
        }
    } catch (IOException e) {
        logger().error("Error forwarding request", e);
        return new DefaultFullHttpResponse(
            HttpVersion.HTTP_1_1,
            HttpResponseStatus.INTERNAL_SERVER_ERROR,
            Unpooled.copiedBuffer("Error forwarding request: " + e.getMessage(), CharsetUtil.UTF_8)
        );
    }
}

public static void main(String[] args) {
    WelcomeUtil.printNativeAgentWelcomeMsg();

    logger().info("check arthas file path...");
    ArthasHomeHandler.findArthasHome();
    logger().info("check arthas file path success");

    NativeAgentBootstrap bootstrap = new NativeAgentBootstrap();
    CLI cli = CLIConfigurator.define(NativeAgentBootstrap.class);
    CommandLine commandLine = cli.parse(Arrays.asList(args));

    try {
        CLIConfigurator.inject(commandLine, bootstrap);
    } catch (Throwable e) {
        logger().error("Missing startup parameter", e);
        System.out.println(usage(cli));
        System.exit(1);
    }
    logger().info("read input config success");

    try {
        logger().info("register native agent...");
        NativeAgentRegistry registry = NativeAgentRegistryFactory
            .getNativeAgentClientRegisterFactory()
            .getServiceRegistration(bootstrap.getRegistrationType());
        registry.registerNativeAgent(
            bootstrap.getRegistrationAddress(),
            bootstrap.getIp(),
            bootstrap.getHttpPortOrDefault() + ":" + bootstrap.getWsPortOrDefault()
        );
        logger().info("register native agent success!");
    } catch (Exception e) {
        logger().error("register native agent failed", e);
        System.exit(1);
    }

    int wsPort = bootstrap.getWsPortOrDefault();
    Thread wsServerThread = new Thread(() -> {
        logger().info("start websocket server on port: {}", wsPort);
        try {
            EventLoopGroup bossGroup = new NioEventLoopGroup();
            EventLoopGroup workerGroup = new NioEventLoopGroup();

            try {
                ServerBootstrap b = new ServerBootstrap()
                    .group(bossGroup, workerGroup)
                    .channel(NioServerSocketChannel.class)
                    .handler(new LoggingHandler(LogLevel.INFO))
                    .childHandler(new ChannelInitializer<SocketChannel>() {
                        @Override
                        protected void initChannel(SocketChannel ch) {
                            ch.pipeline()
                                .addLast(new HttpRequestDecoder())
                                .addLast(new HttpObjectAggregator(MAX_HTTP_CONTENT_LENGTH))
                                .addLast(new HttpResponseEncoder())
                                .addLast(new WebSocketServerProtocolHandler("/ws"))
                                .addLast(new ForwardClientSocketClientHandler());
                        }
                    });

                b.bind("0.0.0.0", wsPort).sync().channel().closeFuture().sync();
                logger().info("websocket server started on port: {}", wsPort);
            } finally {
                bossGroup.shutdownGracefully();
                workerGroup.shutdownGracefully();
                logger().info("websocket server shutdown on port: {}", wsPort);
            }
        } catch (InterruptedException e) {
            logger().error("websocket server interrupted on port: {}", wsPort, e);
            Thread.currentThread().interrupt();
        }
    }, "native-agent-ws-server");
    wsServerThread.start();

    int httpPort = bootstrap.getHttpPortOrDefault();
    logger().info("start http server on port: {}", httpPort);

    EventLoopGroup httpBossGroup = new NioEventLoopGroup();
    EventLoopGroup httpWorkerGroup = new NioEventLoopGroup();

    try {
        ServerBootstrap b = new ServerBootstrap()
            .group(httpBossGroup, httpWorkerGroup)
            .channel(NioServerSocketChannel.class)
            .handler(new LoggingHandler(LogLevel.INFO))
            .childHandler(new ChannelInitializer<SocketChannel>() {
                @Override
                protected void initChannel(SocketChannel ch) {
                    ch.pipeline()
                        .addLast(new HttpServerCodec())
                        .addLast(new HttpObjectAggregator(MAX_HTTP_CONTENT_LENGTH))
                        .addLast(new HttpRequestHandler());
                }
            });

        b.bind("0.0.0.0", httpPort).sync().channel().closeFuture().sync();
        logger().info("http server started on port: {}", httpPort);
    } catch (Exception e) {
        logger().error("failed to start http server on port: {}", httpPort, e);
    } finally {
        httpBossGroup.shutdownGracefully();
        httpWorkerGroup.shutdownGracefully();
        logger().info("http server shutdown");
    }
}

private Map<String, String> parseQueryString(String query) {
    Map<String, String> params = new HashMap<>();
    if (query != null) {
        for (String pair : query.split("&")) {
            int idx = pair.indexOf("=");
            try {
                String key = URLDecoder.decode(pair.substring(0, idx), StandardCharsets.UTF_8.name());
                String value = URLDecoder.decode(pair.substring(idx + 1), StandardCharsets.UTF_8.name());
                params.put(key, value);
            } catch (UnsupportedEncodingException e) {
                // ignored
            }
        }
    }
    return params;
}

private void closeOutboundChannel(Channel inboundChannel) {
    Channel outboundChannel = channelMappings.remove(inboundChannel);
    if (outboundChannel != null) {
        logger().info("Closing outbound channel");
        outboundChannel.close();
    }
}

private ByteBuf readInputStream(InputStream is) throws IOException {
    ByteBuf buffer = Unpooled.buffer();
    byte[] tmp = new byte[1024];
    int length;
    while ((length = is.read(tmp)) != -1) {
        buffer.writeBytes(tmp, 0, length);
    }
    is.close();
    return buffer;
}

