private HttpResponse readFileFromResource(FullHttpRequest request, String path) throws IOException {
    DefaultFullHttpResponse fullResp = null;
    final URL res = HttpTtyConnection.class.getResource("/com/taobao/arthas/core/http" + path);
    if (res != null) {
        fullResp = new DefaultFullHttpResponse(request.protocolVersion(), HttpResponseStatus.OK);
        try (InputStream in = res.openStream()) {
            final byte[] tmp = new byte[256];
            int l;
            while ((l = in.read(tmp)) != -1) {
                fullResp.content().writeBytes(tmp, 0, l);
            }
        }
        final int li = path.lastIndexOf('.');
        if (li != -1 && li != path.length() - 1) {
            final String ext = path.substring(li + 1);
            final String contentType;
            if ("html".equals(ext)) {
                contentType = "text/html";
            } else if ("js".equals(ext)) {
                contentType = "application/javascript";
            } else if ("css".equals(ext)) {
                contentType = "text/css";
            } else {
                contentType = null;
            }
            if (contentType != null) {
                fullResp.headers().set(HttpHeaderNames.CONTENT_TYPE, contentType);
            }
        }
    }
    return fullResp;
}

@Override
public List<ResultModel> pollResults() {
    try {
        lastAccessTime = System.currentTimeMillis();
        final long accessTime = lastAccessTime;
        if (lock.tryLock(500, TimeUnit.MILLISECONDS)) {
            polling = true;
            sendingItemCount = 0;
            long firstResultTime = 0;
            long sendingDelay = 0;
            long waitingTime = 0;
            final List<ResultModel> sendingResults = new ArrayList<ResultModel>(resultBatchSizeLimit);

            while (!closed && sendingResults.size() < resultBatchSizeLimit && 
                   sendingDelay < 100 && waitingTime < pollTimeLimit) {
                final ResultModel aResult = resultQueue.poll(100, TimeUnit.MILLISECONDS);
                if (aResult != null) {
                    sendingResults.add(aResult);
                    if (firstResultTime == 0) {
                        firstResultTime = System.currentTimeMillis();
                    }
                    if (shouldFlush(sendingResults, aResult)) {
                        break;
                    }
                } else {
                    if (firstResultTime > 0) {
                        sendingDelay = System.currentTimeMillis() - firstResultTime;
                    }
                    waitingTime = System.currentTimeMillis() - accessTime;
                }
            }
            if (logger.isDebugEnabled()) {
                logger.debug("pollResults: {}, results: {}", sendingResults.size(), JSON.toJSONString(sendingResults));
            }
            return sendingResults;
        }
    } catch (InterruptedException e) {
        //e.printStackTrace();
    } finally {
        if (lock.isHeldByCurrentThread()) {
            lastAccessTime = System.currentTimeMillis();
            polling = false;
            lock.unlock();
        }
    }
    return Collections.emptyList();
}

@Override
public void draw(CommandProcess process, DashboardModel result) {
    final int width = process.width();
    final int height = process.height();
    final int totalHeight = height - 1;
    int threadTopHeight;
    if (totalHeight <= 24) {
        threadTopHeight = totalHeight / 2;
    } else {
        threadTopHeight = totalHeight / 3;
        if (threadTopHeight < 12) {
            threadTopHeight = 12;
        }
    }
    final int lowerHalf = totalHeight - threadTopHeight;
    int memoryInfoHeight = lowerHalf / 2;
    if (memoryInfoHeight < 8) {
        memoryInfoHeight = Math.min(8, lowerHalf);
    }
    final TableElement runtimeInfoTable = drawRuntimeInfo(result.getRuntimeInfo());
    final TableElement tomcatInfoTable = drawTomcatInfo(result.getTomcatInfo());
    int runtimeInfoHeight = Math.max(runtimeInfoTable.getRows().size(), 
                                    tomcatInfoTable == null ? 0 : tomcatInfoTable.getRows().size());
    if (runtimeInfoHeight < lowerHalf - memoryInfoHeight) {
        memoryInfoHeight = lowerHalf - runtimeInfoHeight;
    } else {
        runtimeInfoHeight = lowerHalf - memoryInfoHeight;
    }
    final int maxMemoryInfoHeight = getMemoryInfoHeight(result.getMemoryInfo());
    memoryInfoHeight = Math.min(memoryInfoHeight, maxMemoryInfoHeight);
    threadTopHeight = totalHeight - memoryInfoHeight - runtimeInfoHeight;

    final String threadInfo = ViewRenderUtil.drawThreadInfo(result.getThreads(), width, threadTopHeight);
    final String memoryAndGc = drawMemoryInfoAndGcInfo(result.getMemoryInfo(), result.getGcInfos(), width, memoryInfoHeight);
    final String runTimeAndTomcat = drawRuntimeInfoAndTomcatInfo(runtimeInfoTable, tomcatInfoTable, width, runtimeInfoHeight);
    process.write(threadInfo + memoryAndGc + runTimeAndTomcat);
}

