private ApiResponse processExecRequest(ApiRequest apiRequest, Session session) {
    final boolean oneTimeAccess = session.get(ONETIME_SESSION_KEY) != null;
    try {
        final String commandLine = apiRequest.getCommand();
        final Map<String, Object> body = new TreeMap<String, Object>();
        body.put("command", commandLine);
        final ApiResponse response = new ApiResponse();
        response.setSessionId(session.getSessionId()).setBody(body);

        if (!session.tryLock()) {
            response.setState(ApiState.REFUSED).setMessage("Another command is executing.");
            return response;
        }

        final int lock = session.getLock();
        PackingResultDistributor packingResultDistributor = null;
        Job job = null;
        try {
            final Job foregroundJob = session.getForegroundJob();
            if (foregroundJob != null) {
                response.setState(ApiState.REFUSED).setMessage("Another job is running.");
                logger.info("Another job is running, jobId: {}", foregroundJob.id());
                return response;
            }
            packingResultDistributor = new PackingResultDistributorImpl(session);
            job = this.createJob(commandLine, session, packingResultDistributor);
            session.setForegroundJob(job);
            updateSessionInputStatus(session, InputStatus.ALLOW_INTERRUPT);
            job.run();
        } catch (Throwable e) {
            logger.error("Exec command failed:" + e.getMessage() + ", command:" + commandLine, e);
            response.setState(ApiState.FAILED).setMessage("Exec command failed:" + e.getMessage());
            return response;
        } finally {
            if (session.getLock() == lock) {
                session.unLock();
            }
        }

        Integer timeout = apiRequest.getExecTimeout();
        if (timeout == null || timeout <= 0) {
            timeout = DEFAULT_EXEC_TIMEOUT;
        }
        final boolean timeExpired = !waitForJob(job, timeout);
        if (timeExpired) {
            logger.warn("Job is exceeded time limit, force interrupt it, jobId: {}", job.id());
            job.interrupt();
            response.setState(ApiState.INTERRUPTED)
                    .setMessage("The job is exceeded time limit, force interrupt");
        } else {
            response.setState(ApiState.SUCCEEDED);
        }

        body.put("jobId", job.id());
        body.put("jobStatus", job.status());
        body.put("timeExpired", timeExpired);
        if (timeExpired) {
            body.put("timeout", timeout);
        }
        body.put("results", packingResultDistributor.getResults());
        response.setSessionId(session.getSessionId()).setBody(body);
        return response;
    } finally {
        if (oneTimeAccess) {
            sessionManager.removeSession(session.getSessionId());
        }
    }
}

private void recursive(int deep, boolean isLast, String prefix, TraceNode node, Callback callback) {
    callback.callback(deep, isLast, prefix, node);
    if (!isLeaf(node)) {
        final List<TraceNode> children = node.getChildren();
        if (children == null) {
            return;
        }
        final int size = children.size();
        for (int index = 0; index < size; index++) {
            final boolean isLastFlag = index == size - 1;
            final String currentPrefix = isLast ? prefix + STEP_EMPTY_BOARD : prefix + STEP_HAS_BOARD;
            recursive(deep + 1, isLastFlag, currentPrefix, children.get(index), callback);
        }
    }
}

private static void renderSubtree(TreeElement parent, ClassLoaderVO parentClassLoader) {
    if (parentClassLoader.getChildren() == null) {
        return;
    }
    for (final ClassLoaderVO childClassLoader : parentClassLoader.getChildren()) {
        final TreeElement child = new TreeElement(childClassLoader.getName());
        parent.addChild(child);
        renderSubtree(child, childClassLoader);
    }
}

public void handleWebSocketFrame(ChannelHandlerContext ctx, WebSocketFrame frame) {
    if (frame instanceof CloseWebSocketFrame) {
        closeOutboundChannel(ctx.channel());
        ctx.close();
        return;
    }

    Channel outboundChannel = channelMappings.get(ctx.channel());
    if (outboundChannel == null || !outboundChannel.isActive()) {
        connectToDestinationServer(ctx, frame);
    } else {
        forwardWebSocketFrame(frame, outboundChannel);
    }
}

