@Override
public void process(CommandProcess process) {
    if ("start".equals(cmd)) {
        Configuration c = null;
        try {
            if (getSettings() == null) setSettings("default");
            c = Configuration.getConfiguration(settings);
        } catch (Throwable e) {
            process.end(-1, "Could not start recording, not able to read settings.");
        }
        Recording r = new Recording(c);

        if (getFilename() != null) {
            try {
                r.setDestination(Paths.get(getFilename()));
            } catch (IOException e) {
                r.close();
                process.end(-1, "Could not start recording, not able to write to file " + getFilename() + e.getMessage());
            }
        }

        if (getMaxSize() != null) {
            try {
                r.setMaxSize(parseSize(getMaxSize()));
            } catch (Exception e) {
                process.end(-1, e.getMessage());
            }
        }

        if (getMaxAge() != null) {
            try {
                r.setMaxAge(Duration.ofNanos(parseTimespan(getMaxAge())));
            } catch (Exception e) {
                process.end(-1, e.getMessage());
            }
        }

        if (isDumpOnExit() != false) {
            r.setDumpOnExit(isDumpOnExit().booleanValue());
        }

        if (getDuration() != null) {
            try {
                r.setDuration(Duration.ofNanos(parseTimespan(getDuration())));
            } catch (Exception e) {
                process.end(-1, e.getMessage());
            }
        }

        r.setName(getName() == null ? "Recording-" + r.getId() : getName());

        long id = r.getId();
        recordings.put(id, r);

        if (getDelay() != null) {
            try {
                r.scheduleStart(Duration.ofNanos(parseTimespan(getDelay())));
                result.setJfrOutput("Recording " + id + " scheduled to start in " + getDelay());
            } catch (Exception e) {
                process.end(-1, e.getMessage());
            }
        } else {
            r.start();
            result.setJfrOutput("Started recording " + id + ".");
        }

        if (duration == null && maxAge == null && maxSize == null) {
            result.setJfrOutput(" No limit specified, using maxsize=250MB as default.");
            r.setMaxSize(250 * 1024L * 1024L);
        }

        if (filename != null && duration != null) {
            result.setJfrOutput(" The result will be written to:\n" + filename);
        }
    } else if ("status".equals(cmd)) {
        if (getRecording() != null) {
            Recording r = recordings.get(getRecording());
            if (r == null) process.end(-1, "Recording not exist.");
            printRecording(r);
        } else {
            List<Recording> recordingList = state != null ? findRecordingByState(state) : new ArrayList<>(recordings.values());
            if (recordingList.isEmpty()) {
                process.end(-1, "No available recordings.\n Use jfr start to start a recording.\n");
            } else {
                for (Recording recording : recordingList) printRecording(recording);
            }
        }
    } else if ("dump".equals(cmd)) {
        if (recordings.isEmpty()) process.end(-1, "No recordings to dump. Use jfr start to start a recording.");
        if (getRecording() != null) {
            Recording r = recordings.get(getRecording());
            if (r == null) process.end(-1, "Recording not exist.");
            if (getFilename() == null) {
                try {
                    setFilename(outputFile());
                } catch (IOException e) {
                    process.end(-1, e.getMessage());
                }
            }
            try {
                r.dump(Paths.get(getFilename()));
                result.setJfrOutput("Dump recording " + r.getId() + ", The result will be written to:\n" + getFilename());
            } catch (IOException e) {
                process.end(-1, "Could not dump. " + e.getMessage());
            }
        } else {
            process.end(-1, "Failed to dump. Please input recording id.");
        }
    } else if ("stop".equals(cmd)) {
        if (recordings.isEmpty()) process.end(-1, "No recordings to stop. Use jfr start to start a recording.");
        if (getRecording() != null) {
            Recording r = recordings.remove(getRecording());
            if (r == null) process.end(-1, "Recording not exist.");
            if (r.getState().toString().matches("CLOSED|STOPPED")) {
                process.end(-1, "Failed to stop recording, state cannot be closed/stopped.");
            }
            if (getFilename() == null) {
                try {
                    setFilename(outputFile());
                } catch (IOException e) {
                    process.end(-1, e.getMessage());
                }
            }
            try {
                r.setDestination(Paths.get(getFilename()));
                r.stop();
                result.setJfrOutput("Stop recording " + r.getId() + ", The result will be written to:\n" + getFilename());
                r.close();
            } catch (IOException e) {
                process.end(-1, "Failed to stop " + r.getName() + ". Could not set destination for " + filename + ": " + e.getMessage());
            }
        } else {
            process.end(-1, "Failed to stop. Please input recording id.");
        }
    } else {
        process.end(-1, "Invalid jfr command. Valid commands: start, status, stop, dump.");
    }
    process.appendResult(result);
    process.end();
}


