@Override
public Map<String, String> findNativeAgent(String address) {
    if (address == null || address.isEmpty()) {
        return null;
    }

    try (ZooKeeper zooKeeper = new ZooKeeper(address, SESSION_TIMEOUT, event -> {
        if (event.getState() == Watcher.Event.KeeperState.SyncConnected) {
            connectedSemaphore.countDown();
        }
    })) {
        connectedSemaphore.await();
        List<String> children = zooKeeper.getChildren(NativeAgentConstants.NATIVE_AGENT_KEY, false);
        Map<String, String> res = new ConcurrentHashMap<>(children.size());
        for (String child : children) {
            String childPath = NativeAgentConstants.NATIVE_AGENT_KEY + "/" + child;
            byte[] data = zooKeeper.getData(childPath, false, new Stat());
            res.put(child, new String(data));
        }
        return res;
    } catch (Exception e) {
        throw new IllegalStateException(e);
    }
}

private FullHttpResponse forwardRequest(FullHttpRequest request, String address) {
    OkHttpClient client = new OkHttpClient.Builder()
        .connectTimeout(10, TimeUnit.SECONDS)
        .readTimeout(30, TimeUnit.SECONDS)
        .writeTimeout(30, TimeUnit.SECONDS)
        .build();

    String url = "http://" + address + "/api/native-agent";
    RequestBody requestBody = RequestBody.create(
        request.content().toString(CharsetUtil.UTF_8),
        MediaType.parse("application/json; charset=utf-8")
    );

    Request okRequest = new Request.Builder()
        .url(url)
        .post(requestBody)
        .build();

    try {
        Response response = client.newCall(okRequest).execute();
        if (response.isSuccessful()) {
            String responseBody = response.body().string();
            DefaultFullHttpResponse fullHttpResponse = new DefaultFullHttpResponse(
                request.getProtocolVersion(),
                HttpResponseStatus.OK,
                Unpooled.copiedBuffer(responseBody, StandardCharsets.UTF_8)
            );
            fullHttpResponse.headers()
                .set(HttpHeaderNames.ACCESS_CONTROL_ALLOW_ORIGIN, "*")
                .set(HttpHeaderNames.ACCESS_CONTROL_ALLOW_METHODS, "GET, POST, PUT, DELETE, OPTIONS")
                .set(HttpHeaderNames.ACCESS_CONTROL_ALLOW_HEADERS, "X-Requested-With, Content-Type, Authorization")
                .set(HttpHeaderNames.CONTENT_TYPE, "application/json")
                .set(HttpHeaderNames.CONTENT_LENGTH, fullHttpResponse.content().readableBytes());
            return fullHttpResponse;
        } else {
            return new DefaultFullHttpResponse(
                HttpVersion.HTTP_1_1,
                HttpResponseStatus.valueOf(response.code()),
                Unpooled.copiedBuffer("Error: " + response.message(), CharsetUtil.UTF_8)
            );
        }
    } catch (IOException e) {
        logger.error("Error forwarding request", e);
        return new DefaultFullHttpResponse(
            HttpVersion.HTTP_1_1,
            HttpResponseStatus.INTERNAL_SERVER_ERROR,
            Unpooled.copiedBuffer("Error forwarding request: " + e.getMessage(), CharsetUtil.UTF_8)
        );
    }
}

