@Override
public int read() throws IOException {
    synchronized (__queue) {
        while (true) {
            if (__ioException != null) {
                IOException e = __ioException;
                __ioException = null;
                throw e;
            }
            if (__bytesAvailable == 0) {
                if (__hasReachedEOF) return EOF;
                if (__threaded) {
                    __queue.notify();
                    try {
                        __readIsWaiting = true;
                        __queue.wait();
                        __readIsWaiting = false;
                    } catch (InterruptedException e) {
                        throw new InterruptedIOException("Fatal thread interruption during read.");
                    }
                } else {
                    __readIsWaiting = true;
                    int ch;
                    boolean mayBlock = true;
                    do {
                        try {
                            if ((ch = __read(mayBlock)) < 0 && ch != WOULD_BLOCK) return ch;
                        } catch (InterruptedIOException e) {
                            synchronized (__queue) {
                                __ioException = e;
                                __queue.notifyAll();
                                try { __queue.wait(100); } catch (InterruptedException ie) { /* ignore */ }
                            }
                            return EOF;
                        }
                        try {
                            if (ch != WOULD_BLOCK) __processChar(ch);
                        } catch (InterruptedException e) {
                            if (__isClosed) return EOF;
                        }
                        mayBlock = false;
                    } while (super.available() > 0 && __bytesAvailable < __queue.length - 1);
                    __readIsWaiting = false;
                }
                continue;
            }
            int ch = __queue[__queueHead];
            if (++__queueHead >= __queue.length) __queueHead = 0;
            --__bytesAvailable;
            if (__bytesAvailable == 0 && __threaded) __queue.notify();
            return ch;
        }
    }
}

