        process.end();
        return;
    } 
    if (this.deleteAll) {
        deleteAllRetransformEntry();
        process.appendResult(retransformModel);
        process.end();
        return;
    } 
    if (this.delete > 0) {
        deleteRetransformEntry(this.delete);
        process.end();
        return;
    } 
    if (this.classPattern != null) {
        Set<Class<?>> searchClass = SearchUtils.searchClass(inst, classPattern, false, this.hashCode);
        if (searchClass.isEmpty()) {
            process.end(-1, "These classes are not found in the JVM and may not be loaded: " + classPattern);
            return;
        }
        if (searchClass.size() > limit) {
            process.end(-1, "match classes size: " + searchClass.size() + ", more than limit: " + limit);
            return;
        }
        try {
            inst.retransformClasses(searchClass.toArray(new Class[0]));
            for (Class<?> clazz : searchClass) retransformModel.addRetransformClass(clazz.getName());
            process.appendResult(retransformModel);
            process.end();
            return;
        } catch (Throwable e) {
            String message = "retransform error! " + e;
            logger.error(message, e);
            process.end(-1, message);
            return;
        }
    }

    for (String path : paths) {
        File file = new File(path);
        if (!file.exists()) { process.end(-1, "file does not exist, path:" + path); return; }
        if (!file.isFile()) { process.end(-1, "not a normal file, path:" + path); return; }
        if (file.length() >= MAX_FILE_SIZE) { 
            process.end(-1, "file size: " + file.length() + " >= " + MAX_FILE_SIZE + ", path: " + path); 
            return;
        }
    }

    Map<String, byte[]> bytesMap = new HashMap<>();
    for (String path : paths) {
        try (RandomAccessFile f = new RandomAccessFile(path, "r")) {
            byte[] bytes = new byte[(int) f.length()];
            f.readFully(bytes);
            bytesMap.put(readClassName(bytes), bytes);
        } catch (Exception e) {
            logger.warn("load class file failed: " + path, e);
            process.end(-1, "load class file failed: " + path + ", error: " + e);
            return;
        }
    }

    if (bytesMap.size() != paths.size()) {
        process.end(-1, "paths may contains same class name!");
        return;
    }

    List<RetransformEntry> retransformEntryList = new ArrayList<>();
    List<Class<?>> classList = new ArrayList<>();
    for (Class<?> clazz : inst.getAllLoadedClasses()) {
        if (!bytesMap.containsKey(clazz.getName())) continue;
        if (hashCode == null && classLoaderClass != null) {
            List<ClassLoader> matchedClassLoaders = ClassLoaderUtils.getClassLoaderByClassName(inst, classLoaderClass);
            if (matchedClassLoaders.size() == 1) {
                hashCode = Integer.toHexString(matchedClassLoaders.get(0).hashCode());
            } else if (matchedClassLoaders.size() > 1) {
                retransformModel
                    .setClassLoaderClass(classLoaderClass)
                    .setMatchedClassLoaders(ClassUtils.createClassLoaderVOList(matchedClassLoaders));
                process.appendResult(retransformModel);
                process.end(-1, "Found more than one classloader by class name, specify with '-c <classloader hash>'");
                return;
            } else {
                process.end(-1, "Can not find classloader by class name: " + classLoaderClass + ".");
                return;
            }
        }
        ClassLoader classLoader = clazz.getClassLoader();
        if (classLoader != null && hashCode != null && 
            !Integer.toHexString(classLoader.hashCode()).equals(hashCode)) continue;

        retransformEntryList.add(new RetransformEntry(clazz.getName(), bytesMap.get(clazz.getName()), 
                hashCode, classLoaderClass));
        classList.add(clazz);
        retransformModel.addRetransformClass(clazz.getName());
    }

    try {
        if (retransformEntryList.isEmpty()) {
            process.end(-1, "These classes are not found in the JVM: " + bytesMap.keySet());
            return;
        }
        addRetransformEntry(retransformEntryList);
        inst.retransformClasses(classList.toArray(new Class[0]));
        process.appendResult(retransformModel);
        process.end();
    } catch (Throwable e) {
        String message = "retransform error! " + e;
        logger.error(message, e);
        process.end(-1, message);
    }
}

V get(Object key, int hash) {
    if (count != 0) {
        for (HashEntry<K, V> e = getFirst(hash); e != null; e = e.next) {
            if (e.hash == hash && keyEq(key, e.key())) {
                Object opaque = e.valueRef;
                if (opaque != null) return e.dereferenceValue(opaque);
                return readValueUnderLock(e);
            }
        }
    }
    return null;
}

