private List<Pair<Class<?>, String>> filter(Set<Class<?>> classes) {
    List<Pair<Class<?>, String>> filteredClasses = new ArrayList<Pair<Class<?>, String>>();
    final Iterator<Class<?>> it = classes.iterator();
    while (it.hasNext()) {
        final Class<?> cls = it.next();
        boolean removeFlag = false;
        if (null == cls) {
            removeFlag = true;
        } else if (isUnsafeClass(cls)) {
            filteredClasses.add(new Pair<Class<?>, String>(cls, "class loaded by Bootstrap Classloader, try to execute `options unsafe true`"));
            removeFlag = true;
        } else if (isExclude(cls)) {
            filteredClasses.add(new Pair<Class<?>, String>(cls, "class is excluded"));
            removeFlag = true;
        } else {
            Pair<Boolean, String> unsupportedResult = isUnsupportedClass(cls);
            if (unsupportedResult.getFirst()) {
                filteredClasses.add(new Pair<Class<?>, String>(cls, unsupportedResult.getSecond()));
                removeFlag = true;
            }
        }
        if (removeFlag) {
            it.remove();
        }
    }
    return filteredClasses;
}

@Override
public void atInvokeException(Class<?> cls, String invokeInfo, Object target, Throwable throwable) {
    ClassLoader classLoader = cls.getClassLoader();
    String[] info = StringUtils.splitInvokeInfo(invokeInfo);
    String owner = info[0];
    String methodName = info[1];
    String methodDesc = info[2];

    List<AdviceListener> listeners = com.taobao.arthas.grpcweb.grpc.service.advisor.AdviceListenerManager.queryTraceAdviceListeners(classLoader, cls.getName(),
        owner, methodName, methodDesc);

    if (listeners != null) {
        for (AdviceListener adviceListener : listeners) {
            try {
                if (skipAdviceListener(adviceListener)) {
                    continue;
                }
                final InvokeTraceable listener = (InvokeTraceable) adviceListener;
                listener.invokeThrowTracing(classLoader, owner, methodName, methodDesc, Integer.parseInt(info[3]));
            } catch (Throwable e) {
                logger.error("class: {}, invokeInfo: {}", cls.getName(), invokeInfo, e);
            }
        }
    }
}

