@Override
public int read() throws IOException {
    synchronized (__queue) {
        while (true) {
            if (__ioException != null) {
                IOException e = __ioException;
                __ioException = null;
                throw e;
            }

            if (__bytesAvailable == 0) {
                if (__hasReachedEOF) return EOF;

                if (__threaded) {
                    __queue.notify();
                    try {
                        __readIsWaiting = true;
                        __queue.wait();
                        __readIsWaiting = false;
                    } catch (InterruptedException e) {
                        throw new InterruptedIOException("Fatal thread interruption during read.");
                    }
                } else {
                    __readIsWaiting = true;
                    try {
                        int ch;
                        do {
                            ch = __read(true);
                            if (ch < 0 && ch != WOULD_BLOCK) return ch;
                            if (ch != WOULD_BLOCK) __processChar(ch);
                        } while (super.available() > 0 && __bytesAvailable < __queue.length - 1);
                    } finally {
                        __readIsWaiting = false;
                    }
                }
                continue;
            }

            int ch = __queue[__queueHead];
            __queueHead = (__queueHead + 1) % __queue.length;
            __bytesAvailable--;

            if (__bytesAvailable == 0 && __threaded) {
                __queue.notify();
            }
            return ch;
        }
    }
}

@Override
public void process(CommandProcess process) {
    initTransformer();
    Instrumentation inst = process.session().getInstrumentation();
    RetransformModel retransformModel = new RetransformModel();

    if (this.list) {
        retransformModel.setRetransformEntries(allRetransformEntries());
        process.appendResult(retransformModel).end();
        return;
    }
    if (this.deleteAll) {
        deleteAllRetransformEntry();
        process.appendResult(retransformModel).end();
        return;
    }
    if (this.delete > 0) {
        deleteRetransformEntry(this.delete);
        process.end();
        return;
    }
    if (this.classPattern != null) {
        Set<Class<?>> classes = SearchUtils.searchClass(inst, classPattern, false, this.hashCode);
        if (classes.isEmpty()) {
            process.end(-1, "Classes not found: " + classPattern);
            return;
        }
        if (classes.size() > limit) {
            process.end(-1, "Matched " + classes.size() + " classes exceeds limit " + limit);
            return;
        }
        try {
            inst.retransformClasses(classes.toArray(new Class[0]));
            classes.forEach(c -> retransformModel.addRetransformClass(c.getName()));
            process.appendResult(retransformModel).end();
        } catch (Throwable e) {
            process.end(-1, "Retransform error: " + e);
        }
        return;
    }

    Map<String, byte[]> bytesMap = new HashMap<>();
    for (String path : paths) {
        try (RandomAccessFile f = new RandomAccessFile(path, "r")) {
            byte[] bytes = new byte[(int) f.length()];
            f.readFully(bytes);
            bytesMap.put(readClassName(bytes), bytes);
        } catch (Exception e) {
            process.end(-1, "File error: " + path + " - " + e);
            return;
        }
    }

    List<Class<?>> classList = new ArrayList<>();
    List<RetransformEntry> entries = new ArrayList<>();

    for (Class<?> clazz : inst.getAllLoadedClasses()) {
        if (!bytesMap.containsKey(clazz.getName())) continue;

        if (hashCode == null && classLoaderClass != null) {
            List<ClassLoader> loaders = ClassLoaderUtils.getClassLoaderByClassName(inst, classLoaderClass);
            if (loaders.size() != 1) {
                retransformModel.setClassLoaderClass(classLoaderClass)
                               .setMatchedClassLoaders(ClassUtils.createClassLoaderVOList(loaders));
                process.appendResult(retransformModel)
                      .end(-1, loaders.isEmpty() ? "No classloader found" : "Ambiguous classloader");
                return;
            }
            hashCode = Integer.toHexString(loaders.get(0).hashCode());
        }

        ClassLoader loader = clazz.getClassLoader();
        if (loader != null && hashCode != null && 
            !Integer.toHexString(loader.hashCode()).equals(hashCode)) continue;

        entries.add(new RetransformEntry(clazz.getName(), bytesMap.get(clazz.getName()), 
                                       hashCode, classLoaderClass));
        classList.add(clazz);
        retransformModel.addRetransformClass(clazz.getName());
    }

    try {
        if (entries.isEmpty()) {
            process.end(-1, "Classes not loaded: " + bytesMap.keySet());
            return;
        }
        addRetransformEntry(entries);
        inst.retransformClasses(classList.toArray(new Class[0]));
        process.appendResult(retransformModel).end();
    } catch (Throwable e) {
        process.end(-1, "Retransform failed: " + e);
    }
}

V get(Object key, int hash) {
    if (count != 0) {
        for (HashEntry<K, V> e = getFirst(hash); e != null; e = e.next) {
            if (e.hash == hash && keyEq(key, e.key())) {
