@Override
protected void channelRead0(ChannelHandlerContext ctx, FullHttpRequest request) throws URISyntaxException, IOException {
    String uri = new URI(request.uri()).getPath();
    if ("/favicon.ico".equals(uri)) return;
    if ("/".equals(uri)) uri = "/index.html";

    String path = Paths.get(STATIC_LOCATION, uri).toString();
    File file = new File(path);

    if (HttpUtil.is100ContinueExpected(request)) {
        send100Continue(ctx);
    }

    if (file.isHidden() || !file.exists() || file.isDirectory() || !file.isFile()) {
        sendNotFound(ctx);
        return;
    }

    try (RandomAccessFile randomAccessFile = new RandomAccessFile(file, "r")) {
        HttpResponse response = new DefaultHttpResponse(request.protocolVersion(), HttpResponseStatus.OK);
        String contentType = "text/plain";
        if (path.endsWith(".html")) {
            contentType = "text/html; charset=UTF-8";
        } else if (path.endsWith(".js")) {
            contentType = "application/x-javascript";
        } else if (path.endsWith(".css")) {
            contentType = "text/css; charset=UTF-8";
        } else {
            contentType = new MimetypesFileTypeMap().getContentType(path);
        }
        response.headers().set(HttpHeaderNames.CONTENT_TYPE, contentType);

        boolean keepAlive = HttpUtil.isKeepAlive(request);
        if (keepAlive) {
            response.headers().set(HttpHeaderNames.CONTENT_LENGTH, randomAccessFile.length());
            response.headers().set(HttpHeaderNames.CONNECTION, HttpHeaderValues.KEEP_ALIVE);
        }

        ctx.write(response);
        ChannelFuture sendFileFuture;
        if (ctx.pipeline().get(SslHandler.class) == null) {
            sendFileFuture = ctx.write(new DefaultFileRegion(randomAccessFile.getChannel(), 0, randomAccessFile.length()), ctx.newProgressivePromise());
            ctx.writeAndFlush(LastHttpContent.EMPTY_LAST_CONTENT);
        } else {
            sendFileFuture = ctx.writeAndFlush(new HttpChunkedInput(new ChunkedFile(randomAccessFile, 0, randomAccessFile.length(), 10 * 1024 * 1024)),
                    ctx.newProgressivePromise());
        }

        sendFileFuture.addListener((ChannelProgressiveFutureListener) future -> {
            if (future.isSuccess()) {
                logger.info("{} Transfer complete.", future.channel());
            }
        });

        if (!keepAlive) {
            sendFileFuture.addListener(ChannelFutureListener.CLOSE);
        }
    } catch (FileNotFoundException e) {
        sendNotFound(ctx);
    }
}

@Override
public void query(ObjectQuery query, StreamObserver<ObjectQueryResult> responseObserver) {
    if (vmTool == null) {
        throw Status.UNAVAILABLE.withDescription("vmtool unavailable").asRuntimeException();
    }

    ArthasStreamObserver<ObjectQueryResult> arthasStreamObserver = new ArthasStreamObserverImpl<>(responseObserver, null, grpcJobController);
    String className = query.getClassName();
    String classLoaderHash = query.getClassLoaderHash();
    String classLoaderClass = query.getClassLoaderClass();

    if (isEmpty(classLoaderHash) && isEmpty(classLoaderClass)) {
        List<Class<?>> foundClassList = Arrays.stream(inst.getAllLoadedClasses())
            .filter(clazz -> clazz.getName().equals(className))
            .collect(Collectors.toList());

        if (foundClassList.isEmpty()) {
            arthasStreamObserver.onNext(buildErrorResult("Class not found: " + className));
            return;
        } else if (foundClassList.size() > 1) {
            arthasStreamObserver.onNext(buildErrorResult("Multiple classes found: " + className));
            return;
        }

        processClassInstances(foundClassList.get(0), query, arthasStreamObserver);
        return;
    }

    Class<?> foundClass = findClassWithLoader(className, classLoaderHash, classLoaderClass);
    if (foundClass == null) {
        arthasStreamObserver.onNext(buildErrorResult("Class not found: " + className));
        return;
    }

    processClassInstances(foundClass, query, arthasStreamObserver);
}

private ObjectQueryResult.Builder buildErrorResult(String message) {
    return ObjectQueryResult.newBuilder().setSuccess(false).setMessage(message);
}

private void processClassInstances(Class<?> clazz, ObjectQuery query, ArthasStreamObserver<ObjectQueryResult> observer) {
    Object[] instances = vmTool.getInstances(clazz, query.getLimit());
    Object value = processExpressions(clazz, instances, query.getExpress(), query.getResultExpress());
    JavaObject javaObject = JavaObjectConverter.toJavaObjectWithExpand(value, query.getDepth());
    observer.onNext(ObjectQueryResult.newBuilder().setSuccess(true).addObjects(javaObject).build());
    observer.onCompleted();
}

