private List<Pair<Class<?>, String>> filter(Set<Class<?>> classes) {
    List<Pair<Class<?>, String>> filteredClasses = new ArrayList<>();
    Iterator<Class<?>> it = classes.iterator();
    while (it.hasNext()) {
        Class<?> clazz = it.next();
        boolean removeFlag = false;
        String reason = null;

        if (clazz == null) {
            reason = "null class";
        } else if (isUnsafeClass(clazz)) {
            reason = "bootstrap classloader class";
        } else if (isExclude(clazz)) {
            reason = "excluded class";
        } else {
            Pair<Boolean, String> result = isUnsupportedClass(clazz);
            if (result.getFirst()) {
                reason = result.getSecond();
            }
        }

        if (reason != null) {
            filteredClasses.add(Pair.of(clazz, reason));
            it.remove();
        }
    }
    return filteredClasses;
}

@Override
public void atInvokeException(Class<?> clazz, String invokeInfo, Object target, Throwable throwable) {
    ClassLoader classLoader = clazz.getClassLoader();
    String[] info = StringUtils.splitInvokeInfo(invokeInfo);
    List<AdviceListener> listeners = AdviceListenerManager.queryTraceAdviceListeners(
        classLoader, clazz.getName(), info[0], info[1], info[2]);

    for (AdviceListener listener : listeners) {
        try {
            if (skipAdviceListener(listener)) continue;
            ((InvokeTraceable) listener).invokeThrowTracing(
                classLoader, info[0], info[1], info[2], Integer.parseInt(info[3]));
        } catch (Throwable e) {
            logger.error("Error handling invoke exception for class: {}", clazz.getName(), e);
        }
    }
}

