public void parseRequestParams(WatchRequest watchRequest) {
    classPattern = watchRequest.getClassPattern();
    methodPattern = watchRequest.getMethodPattern();
    if (StringUtils.isEmpty(watchRequest.getExpress())) {
        express = "{params, target, returnObj}";
    } else {
        express = watchRequest.getExpress();
    }
    conditionExpress = watchRequest.getConditionExpress();
    isBefore = watchRequest.getIsBefore();
    isFinish = watchRequest.getIsFinish();
    isException = watchRequest.getIsException();
    isSuccess = watchRequest.getIsSuccess();
    if (!watchRequest.getIsBefore() && !watchRequest.getIsFinish() && !watchRequest.getIsException() && !watchRequest.getIsSuccess()) {
        isFinish = true;
    }
    if (watchRequest.getExpand() <= 0) {
        expand = 1;
    } else if (watchRequest.getExpand() > MAX_EXPAND) {
        expand = MAX_EXPAND;
    } else {
        expand = watchRequest.getExpand();
    }
    if (watchRequest.getSizeLimit() == 0) {
        sizeLimit = 10 * 1024 * 1024;
    } else {
        sizeLimit = watchRequest.getSizeLimit();
    }
    isRegEx = watchRequest.getIsRegEx();
    if (watchRequest.getNumberOfLimit() == 0) {
        numberOfLimit = 100;
    } else {
        numberOfLimit = watchRequest.getNumberOfLimit();
    }
    if (watchRequest.getExcludeClassPattern().isEmpty()) {
        excludeClassPattern = null;
    } else {
        excludeClassPattern = watchRequest.getExcludeClassPattern();
    }
    listenerId = watchRequest.getListenerId();
    verbose = watchRequest.getVerbose();
    if (watchRequest.getMaxNumOfMatchedClass() == 0) {
        maxNumOfMatchedClass = 50;
    } else {
        maxNumOfMatchedClass = watchRequest.getMaxNumOfMatchedClass();
    }
    jobId = watchRequest.getJobId();
}

public synchronized EnhancerAffect enhance(Instrumentation inst, int maxNumOfMatchedClass) throws UnmodifiableClassException {
    matchingClasses = GlobalOptions.isDisableSubClass
            ? SearchUtils.searchClass(inst, classNameMatcher)
            : SearchUtils.searchSubClass(inst, SearchUtils.searchClass(inst, classNameMatcher));

    if (matchingClasses.size() > maxNumOfMatchedClass) {
        affect.setOverLimitMsg("The number of matched classes is " + matchingClasses.size() + ", greater than limit " + maxNumOfMatchedClass + ". Try option '-m <arg>'.");
        return affect;
    }

    List<Pair<Class<?>, String>> filtedList = filter(matchingClasses);
    if (!filtedList.isEmpty()) {
        for (Pair<Class<?>, String> filted : filtedList) {
            logger.info("ignore class: {}, reason: {}", filted.getFirst().getName(), filted.getSecond());
        }
    }

    logger.info("enhance matched classes: {}", matchingClasses);
    affect.setTransformer(this);

    try {
        DemoBootstrap.getRunningInstance().getTransformerManager().addTransformer(this, isTracing);

        if (GlobalOptions.isBatchReTransform) {
            int size = matchingClasses.size();
            Class<?>[] classArray = new Class<?>[size];
            arraycopy(matchingClasses.toArray(), 0, classArray, 0, size);
            if (classArray.length > 0) {
                inst.retransformClasses(classArray);
                logger.info("Success to batch transform classes: " + Arrays.toString(classArray));
            }
        } else {
            for (Class<?> clazz : matchingClasses) {
                try {
                    inst.retransformClasses(clazz);
                    logger.info("Success to transform class: " + clazz);
                } catch (Throwable t) {
                    logger.warn("retransform {} failed.", clazz, t);
                    if (t instanceof UnmodifiableClassException) {
                        throw (UnmodifiableClassException) t;
                    } else if (t instanceof RuntimeException) {
                        throw (RuntimeException) t;
                    } else {
                        throw new RuntimeException(t);
                    }
                }
            }
        }
    } catch (Throwable e) {
        logger.error("Enhancer error, matchingClasses: {}", matchingClasses, e);
        affect.setThrowable(e);
    }

    return affect;
}

