private List<Pair<Class<?>, String>> filter(Set<Class<?>> classes) {
    List<Pair<Class<?>, String>> filteredClasses = new ArrayList<>();
    Iterator<Class<?>> it = classes.iterator();
    while (it.hasNext()) {
        Class<?> clazz = it.next();
        boolean removeFlag = false;
        if (clazz == null) {
            removeFlag = true;
        } else if (isUnsafeClass(clazz)) {
            filteredClasses.add(Pair.of(clazz, "Bootstrap classloader class, try `options unsafe true`"));
            removeFlag = true;
        } else if (isExclude(clazz)) {
            filteredClasses.add(Pair.of(clazz, "Excluded class"));
            removeFlag = true;
        } else {
            Pair<Boolean, String> unsupportedResult = isUnsupportedClass(clazz);
            if (unsupportedResult.getFirst()) {
                filteredClasses.add(Pair.of(clazz, unsupportedResult.getSecond()));
                removeFlag = true;
            }
        }
        if (removeFlag) {
            it.remove();
        }
    }
    return filteredClasses;
}

@Override
public void atInvokeException(Class<?> clazz, String invokeInfo, Object target, Throwable throwable) {
    ClassLoader classLoader = clazz.getClassLoader();
    String[] info = StringUtils.splitInvokeInfo(invokeInfo);
    String owner = info[0];
    String methodName = info[1];
    String methodDesc = info[2];

    List<AdviceListener> listeners = AdviceListenerManager.queryTraceAdviceListeners(
            classLoader, clazz.getName(), owner, methodName, methodDesc);

    if (listeners != null) {
        for (AdviceListener adviceListener : listeners) {
            if (skipAdviceListener(adviceListener)) continue;
            try {
                ((InvokeTraceable) adviceListener).invokeThrowTracing(
                        classLoader, owner, methodName, methodDesc, Integer.parseInt(info[3]));
            } catch (Throwable e) {
                logger.error("Error handling invoke exception: {} {}", clazz.getName(), invokeInfo, e);
            }
        }
    }
}

