private Pair<String, String> extractComponents(String path) throws IllegalArgumentException {
    String[] parts = path.substring(1).split("/");
    if (parts.length != 2) {
        throw new IllegalArgumentException("Invalid path format: " + path);
    }

    String className = parts[0];
    String methodName = parts[1].substring(0, 1).toLowerCase() + parts[1].substring(1);
    return new Pair<>(className, methodName);
}

