public void loggers(CommandProcess process) {
    Map<ClassLoader, LoggerTypes> classLoaderLoggerMap = new LinkedHashMap<ClassLoader, LoggerTypes>();

    //  classloader classloader  logger 
    for (Class<?> clazz : process.session().getInstrumentation().getAllLoadedClasses()) {
        String className = clazz.getName();
        ClassLoader classLoader = clazz.getClassLoader();

        // if special classloader
        if (this.hashCode != null && !this.hashCode.equals(StringUtils.classLoaderHash(clazz))) {
            continue;
        }

        if (classLoader != null) {
            LoggerTypes loggerTypes = classLoaderLoggerMap.get(classLoader);
            if (loggerTypes == null) {
                loggerTypes = new LoggerTypes();
                classLoaderLoggerMap.put(classLoader, loggerTypes);
            }
            updateLoggerType(loggerTypes, classLoader, className);
        }
    }

    for (Entry<ClassLoader, LoggerTypes> entry : classLoaderLoggerMap.entrySet()) {
        ClassLoader classLoader = entry.getKey();
        LoggerTypes loggerTypes = entry.getValue();

        if (loggerTypes.contains(LoggerType.LOG4J)) {
            Map<String, Map<String, Object>> loggerInfoMap = loggerInfo(classLoader, Log4jHelper.class);
            process.appendResult(new LoggerModel(loggerInfoMap));
        }

        if (loggerTypes.contains(LoggerType.LOGBACK)) {
            Map<String, Map<String, Object>> loggerInfoMap = loggerInfo(classLoader, LogbackHelper.class);
            process.appendResult(new LoggerModel(loggerInfoMap));
        }

        if (loggerTypes.contains(LoggerType.LOG4J2)) {
            Map<String, Map<String, Object>> loggerInfoMap = loggerInfo(classLoader, Log4j2Helper.class);
            process.appendResult(new LoggerModel(loggerInfoMap));
        }
    }

    process.end();
}

private void agentRegister(ChannelHandlerContext ctx, HandshakeComplete handshake, String requestUri) throws URISyntaxException {
    QueryStringDecoder queryDecoder = new QueryStringDecoder(requestUri);
    Map<String, List<String>> parameters = queryDecoder.parameters();

    String appName = null;
    List<String> appNameList = parameters.get(URIConstans.APP_NAME);
    if (appNameList != null && !appNameList.isEmpty()) {
        appName = appNameList.get(0);
    }

    String id = null;
    if (appName != null) {
        id = appName + "_" + RandomStringUtils.random(20, true, true).toUpperCase();
    } else {
        id = RandomStringUtils.random(20, true, true).toUpperCase();
    }
    List<String> idList = parameters.get(URIConstans.ID);
    if (idList != null && !idList.isEmpty()) {
        id = idList.get(0);
    }

    String arthasVersion = null;
    List<String> arthasVersionList = parameters.get(URIConstans.ARTHAS_VERSION);
    if (arthasVersionList != null && !arthasVersionList.isEmpty()) {
        arthasVersion = arthasVersionList.get(0);
    }

    final String finalId = id;

    URI responseUri = UriComponentsBuilder.newInstance().scheme(URIConstans.RESPONSE).path("/")
            .queryParam(URIConstans.METHOD, MethodConstants.AGENT_REGISTER).queryParam(URIConstans.ID, id).build()
            .encode().toUri();

    AgentInfo info = new AgentInfo();

    HttpHeaders headers = handshake.requestHeaders();
    String host = HttpUtils.findClientIP(headers);

    if (host == null) {
        SocketAddress remoteAddress = ctx.channel().remoteAddress();
        if (remoteAddress instanceof InetSocketAddress) {
            InetSocketAddress inetSocketAddress = (InetSocketAddress) remoteAddress;
            info.setHost(inetSocketAddress.getHostString());
            info.setPort(inetSocketAddress.getPort());
        }
    } else {
        info.setHost(host);
        Integer port = HttpUtils.findClientPort(headers);
        if (port != null) {
            info.setPort(port);
        }
    }

    info.setChannelHandlerContext(ctx);
    if (arthasVersion != null) {
        info.setArthasVersion(arthasVersion);
    }

    tunnelServer.addAgent(id, info);
    ctx.channel().closeFuture().addListener(new GenericFutureListener<Future<? super Void>>() {
        @Override
        public void operationComplete(Future<? super Void> future) throws Exception {
            tunnelServer.removeAgent(finalId);
        }

    });

    ctx.channel().writeAndFlush(new TextWebSocketFrame(responseUri.toString()));
}

public ChannelFuture connect(boolean reconnect) throws SSLException, URISyntaxException, InterruptedException {
    QueryStringEncoder queryEncoder = new QueryStringEncoder(this.tunnelServerUrl);
    queryEncoder.addParam(URIConstans.METHOD, MethodConstants.AGENT_REGISTER);
    queryEncoder.addParam(URIConstans.ARTHAS_VERSION, this.version);
    if (appName != null) {
        queryEncoder.addParam(URIConstans.APP_NAME, appName);
    }
    if (id != null) {
        queryEncoder.addParam(URIConstans.ID, id);
    }
    // ws://127.0.0.1:7777/ws?method=agentRegister
    URI agentRegisterURI = queryEncoder.toUri();

    logger.info("Try to register arthas agent, uri: {}", agentRegisterURI);

    String scheme = agentRegisterURI.getScheme() == null ? "ws" : agentRegisterURI.getScheme();
    String host = agentRegisterURI.getHost() == null ? "127.0.0.1" : agentRegisterURI.getHost();
    int port;
    if (agentRegisterURI.getPort() == -1) {
        if ("ws".equalsIgnoreCase(scheme)) {
            port = 80;
        } else if ("wss".equalsIgnoreCase(scheme)) {
            port = 443;
        } else {
            port = -1;
        }
    } else {
        port = agentRegisterURI.getPort();
    }

    if (!"ws".equalsIgnoreCase(scheme) && !"wss".equalsIgnoreCase(scheme)) {
        throw new IllegalArgumentException("Only WS(S) is supported. tunnelServerUrl: " + tunnelServerUrl);
    }

    boolean ssl = "wss".equalsIgnoreCase(scheme);
    SslContext sslCtx;
    if (ssl) {
        sslCtx = SslContextBuilder.forClient().trustManager(InsecureTrustManagerFactory.INSTANCE).build();
    } else {
        sslCtx = null;
    }

    WebSocketClientProtocolConfig clientProtocolConfig = WebSocketClientProtocolConfig.newBuilder()
        .webSocketUri(agentRegisterURI)
        .maxFramePayloadLength(ArthasConstants.MAX_HTTP_CONTENT_LENGTH)
        .build();

    WebSocketClientProtocolHandler websocketClientHandler = new WebSocketClientProtocolHandler(
        clientProtocolConfig);
    TunnelClientSocketClientHandler handler = new TunnelClientSocketClientHandler(TunnelClient.this);

    Bootstrap bs = new Bootstrap();
    bs.group(eventLoopGroup);
    bs.option(ChannelOption.CONNECT_TIMEOUT_MILLIS, 5000);
    bs.option(ChannelOption.TCP_NODELAY, true);
    bs.channel(NioSocketChannel.class);
    bs.remoteAddress(host, port);
    bs.handler(new ChannelInitializer<SocketChannel>() {
        @Override
        protected void initChannel(SocketChannel ch) {
            ChannelPipeline p = ch.pipeline();
            if (sslCtx != null) {
                p.addLast(sslCtx.newHandler(ch.alloc(), host, port));
            }

            p.addLast(
                new HttpClientCodec(),
                new HttpObjectAggregator(ArthasConstants.MAX_HTTP_CONTENT_LENGTH),
                websocketClientHandler,
                new IdleStateHandler(0, 0, ArthasConstants.WEBSOCKET_IDLE_SECONDS),
                handler
            );
        }
    });

    ChannelFuture connectFuture = bs.connect();
    if (reconnect) {
        connectFuture.addListener(new ChannelFutureListener() {
            @Override
            public void operationComplete(ChannelFuture future) throws Exception {
                if (future.cause() != null) {
                    logger.error("connect to tunnel server error, uri: {}", tunnelServerUrl, future.cause());
                }
            }
        });
    }
    connectFuture.sync();

    return handler.registerFuture();
}

@Override
public int read() throws IOException {
    // Critical section because we're altering __bytesAvailable,
    // __queueHead, and the contents of _queue in addition to
    // testing value of __hasReachedEOF.
    synchronized (__queue) {
        while (true) {
            if (__ioException != null) {
                IOException e;
                e = __ioException;
                __ioException = null;
                throw e;
            }

            if (__bytesAvailable == 0) {
                // Return EOF if at end of file
                if (__hasReachedEOF) {
                    return EOF;
                }

                // Otherwise, we have to wait for queue to get something
                if (__threaded) {
                    __queue.notify();
                    try {
                        __readIsWaiting = true;
                        __queue.wait();
                        __readIsWaiting = false;
                    } catch (InterruptedException e) {
                        throw new InterruptedIOException("Fatal thread interruption during read.");
                    }
                } else {
                    //__alreadyread = false;
                    __readIsWaiting = true;
                    int ch;
                    boolean mayBlock = true;    // block on the first read only

                    do {
                        try {
                            if ((ch = __read(mayBlock)) < 0) { // must be EOF
                                if (ch != WOULD_BLOCK) {
                                    return (ch);
                                }
                            }
                        } catch (InterruptedIOException e) {
                            synchronized (__queue) {
                                __ioException = e;
                                __queue.notifyAll();
                                try {
                                    __queue.wait(100);
                                } catch (InterruptedException interrupted) {
                                    // Ignored
                                }
                            }
                            return EOF;
                        }

                        try {
                            if (ch != WOULD_BLOCK) {
                                __processChar(ch);
                            }
                        } catch (InterruptedException e) {
                            if (__isClosed) {
                                return EOF;
                            }
                        }

                        // Reads should not block on subsequent iterations. Potentially, this could happen if the
                        // remaining buffered socket data consists entirely of Telnet command sequence and no "user" data.
                        mayBlock = false;

                    } while (super.available() > 0 && __bytesAvailable < __queue.length - 1); // Continue reading as long as there is data available and the queue is not full.

                    __readIsWaiting = false;
                }
                continue;
            } else {
                int ch;

                ch = __queue[__queueHead];

                if (++__queueHead >= __queue.length) {
                    __queueHead = 0;
                }

                --__bytesAvailable;

                // Need to explicitly notify() so available() works properly
                if (__bytesAvailable == 0 && __threaded) {
                    __queue.notify();
                }

                return ch;
            }
        }
    }
}

@Override
public void process(CommandProcess process) {
    initTransformer();

    RetransformModel retransformModel = new RetransformModel();
    Instrumentation inst = process.session().getInstrumentation();

    if (list) {
        List<RetransformEntry> retransformEntryList = allRetransformEntries();
        retransformModel.setRetransformEntries(retransformEntryList);
        process.appendResult(retransformModel);
        process.end();
        return;
    } else if (deleteAll) {
        deleteAllRetransformEntry();
        process.appendResult(retransformModel);
        process.end();
        return;
    } else if (delete > 0) {
        deleteRetransformEntry(delete);
        process.end();
        return;
    } else if (classPattern != null) {
        Set<Class<?>> searchClass = SearchUtils.searchClass(inst, classPattern, false, hashCode);
        if (searchClass.isEmpty()) {
            process.end(-1, "These classes are not found in the JVM and may not be loaded: " + classPattern);
            return;
        }

        if (searchClass.size() > limit) {
            process.end(-1, "match classes size: " + searchClass.size() + ", more than limit: " + limit
                    + ", It is recommended to use a more precise class pattern.");
        }
        try {
            inst.retransformClasses(searchClass.toArray(new Class[0]));
            for (Class<?> clazz : searchClass) {
                retransformModel.addRetransformClass(clazz.getName());
            }
            process.appendResult(retransformModel);
            process.end();
            return;
        } catch (Throwable e) {
            String message = "retransform error! " + e.toString();
            logger.error(message, e);
            process.end(-1, message);
            return;
        }
    }

    for (String path : paths) {
        File file = new File(path);
        if (!file.exists()) {
            process.end(-1, "file does not exist, path:" + path);
            return;
        }
        if (!file.isFile()) {
            process.end(-1, "not a normal file, path:" + path);
            return;
        }
        if (file.length() >= MAX_FILE_SIZE) {
            process.end(-1, "file size: " + file.length() + " >= " + MAX_FILE_SIZE + ", path: " + path);
            return;
        }
    }

    Map<String, byte[]> bytesMap = new HashMap<String, byte[]>();
    for (String path : paths) {
        RandomAccessFile f = null;
        try {
            f = new RandomAccessFile(path, "r");
            final byte[] bytes = new byte[(int) f.length()];
            f.readFully(bytes);

            final String clazzName = readClassName(bytes);

            bytesMap.put(clazzName, bytes);

        } catch (Exception e) {
            logger.warn("load class file failed: " + path, e);
            process.end(-1, "load class file failed: " + path + ", error: " + e);
            return;
        } finally {
            if (f != null) {
                try {
                    f.close();
                } catch (IOException e) {
                    // ignore
                }
            }
        }
    }

    if (bytesMap.size() != paths.size()) {
        process.end(-1, "paths may contains same class name!");
        return;
    }

    List<RetransformEntry> retransformEntryList = new ArrayList<RetransformEntry>();

    List<Class<?>> classList = new ArrayList<Class<?>>();

    for (Class<?> clazz : inst.getAllLoadedClasses()) {
        if (bytesMap.containsKey(clazz.getName())) {

            if (hashCode == null && classLoaderClass != null) {
                List<ClassLoader> matchedClassLoaders = ClassLoaderUtils.getClassLoaderByClassName(inst,
                        classLoaderClass);
                if (matchedClassLoaders.size() == 1) {
                    hashCode = Integer.toHexString(matchedClassLoaders.get(0).hashCode());
                } else if (matchedClassLoaders.size() > 1) {
                    Collection<ClassLoaderVO> classLoaderVOList = ClassUtils
                            .createClassLoaderVOList(matchedClassLoaders);
                    retransformModel.setClassLoaderClass(classLoaderClass)
                            .setMatchedClassLoaders(classLoaderVOList);
                    process.appendResult(retransformModel);
                    process.end(-1,
                            "Found more than one classloader by class name, please specify classloader with '-c <classloader hash>'");
                    return;
                } else {
                    process.end(-1, "Can not find classloader by class name: " + classLoaderClass + ".");
                    return;
                }
            }

            ClassLoader classLoader = clazz.getClassLoader();
            if (classLoader != null && hashCode != null
                    && !Integer.toHexString(classLoader.hashCode()).equals(hashCode)) {
                continue;
            }

            RetransformEntry retransformEntry = new RetransformEntry(clazz.getName(), bytesMap.get(clazz.getName()),
                    hashCode, classLoaderClass);
            retransformEntryList.add(retransformEntry);
            classList.add(clazz);
            retransformModel.addRetransformClass(clazz.getName());

            logger.info("Try retransform class name: {}, ClassLoader: {}", clazz.getName(), clazz.getClassLoader());
        }
    }

    try {
        if (retransformEntryList.isEmpty()) {
            process.end(-1, "These classes are not found in the JVM and may not be loaded: " + bytesMap.keySet());
            return;
        }
        addRetransformEntry(retransformEntryList);

        inst.retransformClasses(classList.toArray(new Class[0]));

        process.appendResult(retransformModel);
        process.end();
    } catch (Throwable e) {
        String message = "retransform error! " + e.toString();
        logger.error(message, e);
        process.end(-1, message);
    }

}

V get(Object key, int hash) {
    if (count != 0) { // read-volatile
        HashEntry<K, V> e = getFirst(hash);
        while (e != null) {
            if (e.hash == hash && keyEq(key, e.key())) {
                Object opaque = e.valueRef;
                if (opaque != null) {
                    return e.dereferenceValue(opaque);
                }

                return readValueUnderLock(e); // recheck
            }
            e = e.next;
        }
    }
    return null;
}

