static Map<String, String> getHttpHeadersFromMetadata(Metadata trailer) {
    Map<String, String> map = new HashMap<>();
    for (String key : trailer.keys()) {
        if (EXCLUDED.contains(key.toLowerCase())) {
            continue;
        }
        if (key.endsWith(Metadata.BINARY_HEADER_SUFFIX)) {
            // TODO allow any object type here
            byte[] value = trailer.get(Metadata.Key.of(key, Metadata.BINARY_BYTE_MARSHALLER));
            map.put(key, new String(value));
        } else {
            String value = trailer.get(Metadata.Key.of(key, Metadata.ASCII_STRING_MARSHALLER));
            map.put(key, value);
        }
    }
    return map;
}

public byte[] getPrefix(byte[] in, Type type) {
    int len = in.length;
    return new byte[] {
        type.value,
        (byte) ((len >> 24) & 0xff),
        (byte) ((len >> 16) & 0xff),
        (byte) ((len >> 8) & 0xff),
        (byte) ((len >> 0) & 0xff),
    };
}

private Pair<String, String> getClassAndMethod(String pathInfo) throws IllegalArgumentException {
    // Process path info starting from first character
    String[] pathSegments = pathInfo.substring(1).split("/");
    if (pathSegments.length != 2) {
        throw new IllegalArgumentException("Invalid path format: " + pathInfo);
    }

    String className = pathSegments[0];
    String methodNameRaw = pathSegments[1];
    String methodName = methodNameRaw.substring(0, 1).toLowerCase() + methodNameRaw.substring(1);

    return new Pair<>(className, methodName);
}

